    "# Macro nutrients with the highest fiber\n",
    "macro_fiber <- nutri %>%\n",
    "  group_by (Category) %>%\n",
    "  summarise (\n",
    "    avg_protein = mean(Protein, na.rm = TRUE),\n",
    "    avg_Carbs = mean(Carbs, na.rm = TRUE),\n",
    "    avg_fiber = mean(Fiber, na.rm = TRUE),\n",
    "  )\n",
    "    \n",
    "    print(macro_fiber)"
   ]
